import React from 'react';
import { FaGlobe, FaFacebook, FaInstagram, FaTiktok, FaWhatsapp } from 'react-icons/fa';
import { useTheme } from '../utils/theme';
import './../styles/Footer.css';

const Footer = () => {
  const { theme, toggleTheme } = useTheme();
  const [language, setLanguage] = React.useState('es');

  const toggleLanguage = () => {
    setLanguage(prevLang => (prevLang === 'es' ? 'en' : 'es'));
  };

  const quickLinks = [
    { name: 'Inicio', href: '#inicio' },
    { name: 'Directorio', href: '#directorio' },
    { name: 'Eventos', href: '#eventos' },
    { name: 'Blog', href: '#blog' },
    { name: 'Nosotros', href: '#nosotros' },
    { name: 'Contacto', href: '#contacto' }
  ];

  const socialLinks = [
    {
      name: 'Web de la Revista',
      icon: <FaGlobe />,
      url: 'https://revistaestamosentrend.com',
      color: '#FF004F'
    },
    {
      name: 'Facebook',
      icon: <FaFacebook />,
      url: 'https://www.facebook.com/Revistaestamosentrend/',
      color: '#FF004F'
    },
    {
      name: 'Instagram',
      icon: <FaInstagram />,
      url: 'https://www.instagram.com/estamosentrend/',
      color: '#FF004F'
    },
    {
      name: 'TikTok',
      icon: <FaTiktok />,
      url: 'https://www.tiktok.com/@estamosentrend',
      color: '#FF004F'
    }
  ];

  return (
    <footer className="footer">
      <div className="footer-container">
        {/* Informaci√≥n de Contacto */}
        <div className="footer-section">
          <h3>Cont√°ctanos</h3>
          <div className="contact-info">
            <div className="contact-item">
              <span className="contact-icon">üìß</span>
              <a href="mailto:estamosentrend@gmail.com">estamosentrend@gmail.com</a>
            </div>
            <div className="contact-item">
              <span className="contact-icon">üìû</span>
              <a href="tel:+525665828832">+52 56 6582 8832</a>
            </div>
            <div className="contact-item">
              <span className="contact-icon">üïê</span>
              <span>Lun-Vie 9:00 a 18:00</span>
            </div>
            <div className="contact-item">
              <span className="contact-icon">üìç</span>
              <div className="address-info">
                <p><strong>Direcci√≥n Principal:</strong></p>
                <p>Av Diego D√≠az de Berlanga 400, San Nicol√°s de los Garza, Nuevo Le√≥n, M√©xico</p>
                <p><strong>Oficina de Operaciones:</strong></p>
                <p>Azucena 265 Col San Carlos, Guadalajara, Jalisco, M√©xico</p>
              </div>
            </div>
          </div>
        </div>

        {/* Enlaces R√°pidos */}
        <div className="footer-section">
          <h3>Enlaces R√°pidos</h3>
          <nav className="footer-nav">
            <ul>
              {quickLinks.map((link, index) => (
                <li key={index}>
                  <a href={link.href} className="footer-link">
                    {link.name}
                  </a>
                </li>
              ))}
            </ul>
          </nav>
        </div>

        {/* Redes Sociales */}
        <div className="footer-section">
          <h3>S√≠guenos</h3>
          <div className="social-links">
            {socialLinks.map((social, index) => (
              <a
                key={index}
                href={social.url}
                target="_blank"
                rel="noopener noreferrer"
                className="social-link"
                title={social.name}
              >
                {social.icon}
              </a>
            ))}
          </div>
        </div>

        {/* Newsletter/Info Adicional */}
        <div className="footer-section">
          <h3>M√°s Informaci√≥n</h3>
          <div className="additional-info">
            <p>Descubre las mejores experiencias tur√≠sticas y comerciales de M√©xico.</p>
            <p>Tu gu√≠a completa para explorar destinos √∫nicos.</p>
          </div>
        </div>
      </div>

      {/* Derechos de Autor */}
      <div className="footer-bottom">
        <p className="copyright">
          GUIATREND ¬© by EstamosEnTrend 2023 ‚Äì Todos los derechos reservados.
        </p>
      </div>

      {/* Bot√≥n Flotante de WhatsApp */}
      <a
        href="https://wa.me/525665828832"
        className="whatsapp-float"
        target="_blank"
        rel="noopener noreferrer"
        title="Contactar por WhatsApp"
      >
        <FaWhatsapp />
      </a>

      {/* Controles de Tema e Idioma - Movidos al final */}
      <div className="footer-controls-float">
        <button className="control-button-float" onClick={toggleLanguage} title="Cambiar idioma">
          {language === 'es' ? 'üá≤üáΩ' : 'üá¨üáß'}
        </button>
        <button className="control-button-float" onClick={toggleTheme} title="Cambiar tema">
          {theme === 'dark' ? 'üåô' : '‚òÄÔ∏è'}
        </button>
      </div>
    </footer>
  );
};

export default Footer;
